import Athlete from "./Athlete";

const props = {
    Name: "Athlete-Name",
    Date: Date,
    averageScore: {
        Monday: dataMonday,
        Tuesday: dataTuesday,
        Wednesday: dataWednesday,
        Thursday: dataThursday,
        Friday: dataFriday,
        Saturday: dataSaturday,
        Sunday: dataSunday
    },
    weeklyAverage: score
}

function App(){
    <Athlete props={props} />
}

export default App;
